import React from "react";
import "./Header.css";

function SideBar() {
  return (
    <div>
      <div className="mail_button">
        <button className="px-7">메일 쓰기</button>
        <button className="px-7 border-l-[0.5px] border-gray-500">
          내게 쓰기
        </button>
      </div>
      <div>Received Detail</div>
      <div>
        <div className="text-[16px]">9</div>
        <div className="text-[10px]">안읽음</div>
      </div>
    </div>
  );
}

export default SideBar;
